import React, { Component } from 'react'

class UploadImage extends Component {
    render() {
        return (
            <div>
            <input type="file" onChange={this.fileChangedHandler}></input>
            <button onClick={this.uploadHandler}>Upload!</button>
            </div>
        )
    }
}

export default UploadImage;
